const handleSignupSubmit=async a=>{a.preventDefault();try{const a=document.querySelector("#first-name").value.trim(),b=document.querySelector("#last-name").value.trim(),c=document.querySelector("#city").value.trim(),d=document.querySelector("#state").value.trim(),e=document.querySelector("#zip").value.trim(),f=document.querySelector("#email").value.trim(),g=document.querySelector("#role-id").value.trim(),h=document.querySelector("#username").value.trim(),i=document.querySelector("#password").value.trim(),j=document.getElementsByClassName("service"),k=[];for(let a=0;a<j.length;a++)!0===j[a].checked&&k.push(j[a].value);const l=document.querySelector("#confirm-password").value.trim();if(!h||!i)return void alert("You must provide a username and password.");if(i!==l)return void alert("Passwords to not match.");const m=await fetch("/api/client-users",{method:"POST",body:JSON.stringify({username:h,password:i,first_name:a,last_name:b,email:f,city:c,state:d,zip:e,role_id:g,client:{client_services:[...k]}}),headers:{"Content-Type":"application/json; charset=UTF-8"}});if(m.ok){const a=await m.json();window.location.replace(`/client/${a.client.id}`),console.log(a)}else return void alert("Failed to sign up.")}catch(a){console.log(a)}};document.querySelector(".client-signup-form").addEventListener("submit",handleSignupSubmit);